import{_ as a,o as e,c as r,O as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 19.2-52 When search warrant may issue.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-52.md","filePath":"vacode/19.2-52.md"}'),i={name:"vacode/19.2-52.md"},n=t('<h1 id="§-19-2-52-when-search-warrant-may-issue" tabindex="-1">§ 19.2-52 When search warrant may issue. <a class="header-anchor" href="#§-19-2-52-when-search-warrant-may-issue" aria-label="Permalink to &quot;§ 19.2-52 When search warrant may issue.&quot;">​</a></h1><p>Except as provided in § <a href="http://law.lis.virginia.gov/vacode/19.2-56.1/" target="_blank" rel="noreferrer">19.2-56.1</a>, search warrants, based upon complaint on oath supported by an affidavit as required in § <a href="http://law.lis.virginia.gov/vacode/19.2-54/" target="_blank" rel="noreferrer">19.2-54</a>, may be issued by any judge, magistrate or other person having authority to issue criminal warrants, if he be satisfied from such complaint and affidavit that there is reasonable and probable cause for the issuance of such search warrant.</p><p>An application for a search warrant to withdraw blood from a person suspected of violating § <a href="http://law.lis.virginia.gov/vacode/18.2-266/" target="_blank" rel="noreferrer">18.2-266</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-266.1/" target="_blank" rel="noreferrer">18.2-266.1</a>, <a href="http://law.lis.virginia.gov/vacode/18.2-272/" target="_blank" rel="noreferrer">18.2-272</a>, <a href="http://law.lis.virginia.gov/vacode/29.1-738/" target="_blank" rel="noreferrer">29.1-738</a>, <a href="http://law.lis.virginia.gov/vacode/29.1-738.02/" target="_blank" rel="noreferrer">29.1-738.02</a>, or <a href="http://law.lis.virginia.gov/vacode/46.2-341.24/" target="_blank" rel="noreferrer">46.2-341.24</a> shall be given priority over any pending matters not involving an imminent risk to another&#39;s health or safety before such judge, magistrate, or other person having authority to issue criminal warrants.</p><p>Code 1950, § 19.1-83; 1960, c. 366; 1975, c. 495; 1986, c. 636; 2017, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0623" target="_blank" rel="noreferrer">623</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0673" target="_blank" rel="noreferrer">673</a>.</p>',4),o=[n];function s(l,h,c,d,f,g){return e(),r("div",null,o)}const _=a(i,[["render",s]]);export{v as __pageData,_ as default};
